import React from 'react';

class Log extends React.Component {
    constructor(props) {
        super(props);
        this.state = { };
    }

    handleClick(e) {
        e.preventDefault();
        console.log('The link was clicked.');
    }

    render() {
        return (
            <div className="log">
                <table className="logContents">
                    <tbody>
                        <tr>
                            <td width="5%">{this.props.timeStamp}</td>
                            <td width="5%">
                                <button onClick={this.handleClick}>stack</button>
                            </td>
                            <td width="90%">{this.props.log}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

